import React from 'react';

export default function Header() {
    return (
        <header>
            <div className="header__image-container">
                <img
                src="../../assets/Logo/Logo-brainflix.svg" 
                alt="brainflix logo" 
                className="header__image" />
            </div>
            <h1 className="header__title">BrainFlix</h1>
        </header>
    )
}
